def strStr(haystack: str, needle: str) -> int:
    if not needle:
        return 0
    if not haystack:
        return -1

    next_a = [0]
    now = 0
    i = 1
    while i < len(needle):
        if needle[i] == needle[now]:
            now += 1
            next_a.append(now)
            i += 1
        elif now:
            now = next_a[now - 1]
        else:
            next_a.append(0)
            i += 1
    k = 0
    p = 0
    N = len(needle)
    M = len(haystack)
    # ini = 0

    while p + k <= M - 1:
        if needle[k] == haystack[p+k] and k < N - 1:
            k += 1
        elif needle[k] == haystack[p+k] and k == N - 1:
            return p
        else:
            p += next_a[k] + 1
            k = 0
        print(k)
        print(p)
    return -1

